window.bookSummaryJSON = "<p>Greatness is inside you. Now is the time to wake it up. Are you living your most authentic life? Are you leaning into your purpose or running away from it? Is this the story you want your future self to tell or do you ache for something more? </p> <p>Through his breakthrough discoveries, <i>New York Times</i> best-selling author Lewis Howes reveals how you can rewrite your past to propel yourself into a powerful and abundant future.</p> <p>With these raw and revealing personal stories, science-backed strategies from industry-leading experts, and step-by-step guidance, you will learn how to:</p> <ul> <li>Clearly define a Meaningful Mission to enhance your purpose for this season of life</li> <li>Identify the root causes of self-doubt and conquer the fears that hold you back</li> <li>Transform your mind to end self-sabotaging thoughts to live a rich life</li> <li>Manifest your greatness to make the maximum positive impact on those around you</li> </ul> <p>By applying the lessons and strategies found inside <i>The Greatness Mindset</i>, you will be able to design the life of your dreams and turn it into reality.</p> <p>Are you ready? Your journey to greatness begins now!</p>"; 
